create table TelcoAccounts (
	type VARCHAR(17),
	paymentStatus VARCHAR(11),
	creditLimit INT,
	description TEXT,
	id VARCHAR(50),
	name VARCHAR(50),
	state VARCHAR(8),
	accountType VARCHAR(8),
	billStructureId INT,
	financialAccountId INT,
	defaultPaymentMethodId INT,
	relatedPartyId INT,
	taxExemptionId INT,
	contactId INT,
	accountBalanceId INT,
	accountRelationshipId INT
);
